import React, { useState } from "react";
import { Routes, Route } from 'react-router-dom'
import SearchFilter from "./SearchFilter";
import Liked from "./Liked";
import Profile from './Profile'
import LocationFilter from './LocationFilter'
import OpenerPage from './OpenerPage';
import LoginPage from './login';
import { Nav } from './Nav'
import { Footer } from './Footer'

function App() {
  const [likedItems, setLikedItems] = useState([]);

  const handleLike = (title, artwork) => {
    const itemToRemove = { title, artwork };
    const newLikedItems = likedItems.filter(
      (item) => item.title !== itemToRemove.title || item.artwork !== itemToRemove.artwork
    );
    setLikedItems(newLikedItems);
  };

  return (
    <div>
      <Nav/>
      <Routes>
        <Route index element={<LoginPage/> } />
        <Route path='opener' element={<OpenerPage/>} />
        <Route path='gallery' element={<SearchFilter setLikedItems={setLikedItems} likedItems={likedItems} />} />
        <Route path='profile' element={<Profile/>} />
        <Route path='sellers' element={<LocationFilter/> } />
        <Route path='liked' element={<Liked likedItems={likedItems} handleLike={handleLike} />} />
      </Routes>
      <Footer/>
    </div>
  );
}

export default App;
